able>\n			</td>\n			<td valign=\"top\" width=\"50%\">\n				<table border=\"0\">\n					<tbody>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/58934/0/hand.png/14b416a2-a54d-45bf-af49-cf742c2f795f?t=1361344405000?t=1361344405314\" /></td>\n							<td valign=\"top\">\n								<strong>Bluestone welcomes more new policy holders.</strong> Over the last year we are pleased to say that we have seen a 63% increase in new business take up over the previous year.</td>\n						</tr>\n						<tr>\n							<td colspan=\"2\">\n								&nbsp;</td>\n						</tr>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/58934/0/online.png/3314798b-24d4-4021-a783-ca301950017e?t=1361344424000?t=1361344424651\" /></td>\n							<td valign=\"top\">\n								<strong>Less paper work, and less red tape.</strong> Bluestone announced their online claims handling site today. This greatly simplifies the processing of claims and enables us to make payments faster than ever before.</td>\n						</tr>\n					</tbody>\n				</table>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\">\n				<div align=\"right\">\n					<font size=\"1\">Images under license from <a href=\"http://www.sxc.hu/\">www.sxc.hu</a>, with grateful thanks to <a href=\"http://www.sxc.hu/profile/iotdfi\">iotdfi</a> for \"Time\", <a href=\"http://www.sxc.hu/profile/mjamesno\">mjamesno</a> for \"Business World 2\", <a href=\"http://www.sxc.hu/profile/henkster\">henkster</a> for \"Business man modified\" shake, <a href=\"http://www.sxc.hu/profile/wilton\">wilton</a> for \"Laptop and cellphone\".</font></div>\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2013-02-20 07:17:00',NULL,NULL,1,0,62280,'',0,59366,'Admin OpenUnderwriter','2013-02-20 07:20:00'),('3a5b4ec8-6b20-44c5-8d00-64755a0a5868',62287,62288,58934,58909,59366,'Admin OpenUnderwriter','2013-02-20 07:29:11','2013-02-20 07:29:12',0,0,'62286',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><r