rwriter','2013-09-05 23:14:29'),('bbd922d6-5e6c-4b73-a11e-e92edd18bfec',64538,63394,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-06 21:02:18','2013-09-06 21:02:18',0,0,'63392',2.7,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">User Login Strip</Title></root>','user-login-strip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p>\n	Welcome to OpenActuary!</p>\n<p>\n	OpenActuary is a open source shared actuarial data repository. It provides facilities to allow actuarial information and reports to be built and shared both within organisastions and across organisations. Information from an organisation\'s internal systems is extracted, translated and loaded into OpenActuary\'s staging areas. Once validated it is loaded into a shared master database. Reports are authored and run against this data and extracts provided for further analysis by actuaries.</p>\n<p>\n	The panel below lists the sample users defined in OpenActuary, clicking any silhouette&nbsp;will sign you in as that user. The users break into three groups: <strong>OpenActuary Users</strong> are users who are involved directly in the running of the OpenActuary system itself. The two other groups: <strong>Metropolitan Insurance Company Users</strong> and <strong>Star Insurance Company Users</strong>&nbsp;represent example clients of OpenActuary. Each has a complete set of users - one for each primary role supported by OpenActuary.</p>\n<div>\n	<div style=\"overflow-x: auto; overflow-y: hidden; border: 1px solid #1D8412; width: 800px; border-radius: 5px 5px 5px 5px; font-size: 0.85em; line-height: 1.5; padding: 10px; margin: 0 auto;\">\n		<div style=\"width: 1324px\">\n			<div style=\"display: inline-block; border-right: 2px dotted rgb(204,204,204); text-align center\">\n				<div style=\"text-align:center\">\n					OpenAc