INSERT INTO `wikipage` VALUES ('fbe66f5c-045d-4d30-85a5-b84d20110589',65316,65317,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-10 16:19:05','2013-09-10 16:19:05',65315,'Help Index',1,0,'','','creole',0,'','',0,10406,'Adam Administrator OpenUnderwriter','2013-09-10 16:19:05'),('86a0c7d2-05ea-4c6f-9cf9-169ec899a152',65323,65324,52701,10154,10158,'','2013-09-10 16:19:11','2013-09-10 16:19:11',65315,'FrontPage',1,1,'','New','creole',1,'','',0,10158,'','2013-09-10 16:19:11'),('5895a6a8-28b0-459b-a623-ec71f1082b9f',65332,65317,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-10 16:24:29','2013-09-10 16:24:29',65315,'Help Index',1.1,0,'Welcome to the OpenActuary help pages. These pages are arranged such that they group topics that are of general interest to all users and those that are specific to particular types or user into seperate categories. Also included are detailed schema documentation aimed at any user who directly accesses OpenActuary\'s data sources.','','creole',0,'','',0,10406,'Adam Administrator OpenUnderwriter','2013-09-10 16:24:29'),('50bacc7e-b58d-46ba-9fe8-250d503033c9',78701,65317,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:42:25','2013-09-17 06:42:25',65315,'Help Index',1.2,0,'Welcome to the OpenActuary help pages. These pages are arranged such that they group topics that are of general interest to all users and those that are specific to particular types or user into seperate categories. Also included are detailed schema documentation aimed at any user who directly accesses OpenActuary\'s data sources.\n\n*[[Schema Standards|Schema Standards]] A definition of the standards applied to schema design in actuarial databases. This covers such things as column naming standards, and the approach used to handle enumerations (or coding) values.','','creole',0,'','',0,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:42:25'),('5d144e61-d13b-42fe-a047-54224916a3c8',78703,65317,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:45:24','2013-09-17 06:45:24',65315,'Help Index',1.3,0,'Welcome to the OpenActuary help pages. These pages are arranged such that they group topics that are of general interest to all users and those that are specific to particular types or user into seperate categories. Also included are detailed schema documentation aimed at any user who directly accesses OpenActuary\'s data sources.\n\n*[[Schema Standards|Schema Standards]] A definition of the standards applied to schema design in actuarial databases. This covers such things as column naming standards, and the approach used to handle enumerations (or coding) values.\n*[[Motor Schema]] Design specification for the schema used in the pilot.','','creole',0,'','',0,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:45:24'),('a8a7ffd5-01ec-49c5-b937-8a35d65d4dbf',78705,65317,52701,10154,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:45:47','2013-09-17 06:45:47',65315,'Help Index',1.4,0,'Welcome to the OpenActuary help pages. These pages are arranged such that they group topics that are of general interest to all users and those that are specific to particular types or user into seperate categories. Also included are detailed schema documentation aimed at any user who directly accesses OpenActuary\'s data sources.\n\n*[[Schema Standards|Schema Standards]] A definition of the standards applied to schema design in actuarial databases. This covers such things as column naming standards, and the approach used to handle enumerations (or coding) values.\\\\\n*[[Motor Schema|Motor Schema]] Design specification for the schema used in the pilot.','','creole',1,'','',0,10406,'Adam Administrator OpenUnderwriter','2013-09-17 06:45:47');
